import React, { Component } from 'react'
import { NavLink } from 'react-router-dom'

export class Body_CurriculumVitae extends Component {
  render() {
    const download =()=>{
      const url ='../tools/image/Globe.svg';
      const a = document.createElement('a');
      a.style.display = 'none';
      a.href = url;
      a.download = 'Globe.svg';
      document.body.appendChild(a);
      a.click();
      document.body.removeChild(a);
    };
    return (
      <div>
        <main className='Cv d-flex flex-row-reverse justify-content-between'>
            <section className='p-4 shadow-lg'>
               <article>
                <p className='fs-4 ms-3 fw-bold'>Curriculum Vitae</p>
                </article>
               <article onClick={download}>
                <button className='d-flex flex-row gap-2 rounded-5 shadow-lg text-white mt-2 ms-1 pt-2 pb-2 pe-4'><i className='bi-download ms-3'></i>Telecharger</button>
                <div className='d-flex flex-row'>
                <span>
                  <button className='bi-png fs-6 p-2 ms-3 d-flex flex-row gap-2 rounded-circle shadow-lg text-white mt-2 ms-1 pt-2 pb-2 ps-2 pe-2'></button></span>
                  <span><button className='d-flex flex-row gap-2 rounded-5 shadow-lg text-white mt-2 ms-1 pt-1 pb-1 pe-3 ps-3'>.PDF</button></span>
                </div>
                <div className='d-flex flex-row'>
                <span>
                  <button className='bi-png fs-6 p-2 ms-3 d-flex flex-row gap-2 rounded-circle shadow-lg text-white mt-2 ms-1 pt-2 pb-2 ps-2 pe-2'></button></span>
                  <span><button className='d-flex flex-row gap-2 rounded-5 shadow-lg text-white mt-2 ms-1 pt-1 pb-1 pe-3 ps-3'>.Jpeg</button></span>
                </div>
               
                </article>
               <picture>
               </picture>
            </section>
        </main>
      </div>
    )
  }
}

export default Body_CurriculumVitae
